jQuery(document).ready(function(){$('a[href="#"]').click(function(c){c.preventDefault()});$('[data-toggle="tooltip"]').tooltip();var a=function(){var j=new Date();var i=j.getDay();var k=["Sunday","Monday","Tuesday","Wednesday","Thursday","Friday","Saturday"];var n=j.getDate();var c=j.getMonth();var m=["January","February","March","April","May","June","July","August","September","October","November","December"];var e=j.getYear()+1900;switch(n){case (n%10)==1:n+="<sup>St</sup>";break;case (n%10)==2:n+="<sup>Nd</sup>";break;case (n%10)==3:n+="<sup>Rd</sup>";break;default:n+="<sup>Th</sup>"}var h=(j.getMinutes()>9)?j.getMinutes():0+""+j.getMinutes();var l=(j.getSeconds()>9)?j.getSeconds():0+""+j.getSeconds();var f=j.getHours();var g=(f>12)?(f-12):f;g=(g>9)?g:0+""+g;_ts=(f>12)?"PM":"AM";return{day:k[i],date:n,month:m[c],year:e,min:h,sec:l,hr:g,timeState:_ts}};$(".todayDateTop").empty().append(a().day+", "+a().date+" "+a().month+" "+a().year);function b(){$(".actualTimeTop").empty().append(a().hr+":"+a().min+":"+a().sec+""+a().timeState)}b();setInterval(b,1000)});